import styled from 'styled-components';

export default function Navbar() {
  return (
    <NavbarWrapper>
      <Logo />
      <LoginButton />
    </NavbarWrapper>
  );
}

const NavbarWrapper = styled.div`
  width: 100%;
  z-index: 1;
  height: 50px;
  background-color: green;
`;
